import React, { useState } from 'react';
import axios from 'axios';
import { DescricaoTexto, Container, Form, Input, Button } from '../criarCliente/criarClienteStyle';
import { Message } from '../login/LoginStyle';

const ClienteForm = () => {
  const [message, setMessage] = useState('');
  const [cliente, setCliente] = useState({
    chaveDeAcesso: '',
    name: '',
    cpf: '',
    email: '',
    profissao: '',
    sexo: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCliente({
      ...cliente,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = {
      chaveDeAcesso: cliente.chaveDeAcesso,
      name: cliente.name,
      email: cliente.email,
      cpf: cliente.cpf,
      profissao: cliente.profissao,
      sexo: cliente.sexo
    };

    try {
      const response = await axios.post('https://projetoinicialusr.onrender.com/v1/users/criar-cliente', data, {
        headers: {
          'Content-Type': 'application/json'
        }
      });

      setMessage('Cliente Criado com Sucesso!');
        setTimeout(() => {
          navigate('/app');
        }, 600);
      setCliente({
        chaveDeAcesso: '',
        name: '',
        cpf: '',
        email: '',
        profissao: '',
        sexo: ''
      });

    } catch (error) {

      if (error.response) {
        console.error('Erro na resposta:', error.response.data);
        console.error('Status:', error.response.status);
        console.error('Headers:', error.response.headers);
        alert('Erro ao criar cliente: ' + error.response.data.message);
      } else if (error.request) {
        console.error('Erro na requisição:', error.request);
        alert('Erro ao criar cliente: Sem resposta do servidor');
      } else {
        console.error('Erro:', error.message);
        alert('Erro ao criar cliente: ' + error.message);
      }
      console.error('Configuração da requisição:', error.config);
    }
  };

  return (
    <Container>
      <Form onSubmit={handleSubmit}>
        <DescricaoTexto>Criar Conta:</DescricaoTexto>
        <label>
          Nome
          <Input type="text" name="name" value={cliente.name} onChange={handleChange} />
        </label>
        <label>
          Email
          <Input type="email" name="email" value={cliente.email} onChange={handleChange} />
        </label>
        <label>
          CPF
          <Input type="text" name="cpf" value={cliente.cpf} onChange={handleChange} />
        </label>
        <label>
          Profissão
          <Input type="text" name="profissao" value={cliente.profissao} onChange={handleChange} />
        </label>
        <label>
          Sexo
          <Input type="text" name="sexo" value={cliente.sexo} onChange={handleChange} />
        </label>
        <label>
          Chave de Acesso
          <Input type="password" name="chaveDeAcesso" value={cliente.chaveDeAcesso} onChange={handleChange} />
        </label>
        <Button type="submit">Cadastrar</Button>
      </Form>
    </Container>
  );
};

export default ClienteForm;
